// Functions that initialize fancybox CSS module
function initFancyBoxSimple(){
    $(document).ready(function() {
        $('.fancybox').fancybox({
            openEffect  : 'elastic',
			overlayShow: true,
			
			helpers: {
			        overlay: {
			            locked: false // if true (default), the content will be locked into overlay
			        }
			    }
        });
    });
}


//THIS FUNCTION INITIALIZES THE SLIDESHOW BOX
function initSlideshow(){
//SlidesJS Required: Initialize SlidesJS with a jQuery doc ready 

    $(function() {
      $('#slides').slidesjs({
		//THIS SETS THE CONTAINER SIZE FOR THE IMAGE
        width: 380,
        height: 360,
		navigation: {
          effect: "fade"
        },
        pagination: {
          effect: "fade"
        },
        play: {
          active: true,
          auto: true,
          interval: 4000,
          swap: true,
          effect: "fade"
        },
		effect: {
          fade: {
            speed: 400
          }
        }
      });
    });
  // End SlidesJS Required 
}

// Fires whenever a player has finished loading
function onPlayerReady(event) {
    event.target.playVideo();
}

// Fires when the player's state changes.
function onPlayerStateChange(event) {
    // Go to the next video after the current one is finished playing
    if (event.data === 0) {
        $.fancybox.next();
    }
}

